import Head from "next/head";
import NavBar from "./NavBar";


const layoutStyle = {
  display: "flex",
  justifycontent: "spaced-evenly",
  margin: 20,
  padding: 20,
  border: "1px solid #DDD"
};

const Layout = props => (
  <div>
    <Head>
      <title>Crazy</title>
      <link
        rel="stylesheet"
        href="https://bootswatch.com/4/cerulean/bootstrap.min.css"
      />
    </Head>
    <NavBar />

    {props.children}
  </div>
);

export default Layout;
